import React, {Component} from "react";
import {connect} from "react-redux";

class FormDangKy extends Component {
    state = {
        value: {
            id: "",
            productId: "",
            price: "",
            image: "",
            productType: "",
            productDesc: ""
        },


        error: {
            id: "",
            productId: "",
            price: "",
            image: "",
            productType: "",
            productDesc: ""
        },

        touch: {
            id: false,
            productId: false,
            price: false,
            image: false,
            productType: false,
            productDesc: false
        }
    };

    handleValidate = () => {
        const newError = {
            ...this.state.error
        };

        const {value} = this.state;

        for (let prop in value) {
            switch (prop) {
                case "id":
                    {
                        newError[prop] = "";
                        const isExist = this.props.listProduct.find((product) => + product.id === Number(value[prop]));
                        const isNotEdit = !this.props.productEdit;

                        if (isExist && isNotEdit) {
                            newError[prop] = "Id đã tồn tại.";
                        }
                        const REGEX_NUMBER = /^\d+$/;
                        if (! REGEX_NUMBER.test(value[prop])) {
                            newError[prop] = "phải là số";
                        }
                        if (value[prop].length === 0) {
                            newError[prop] = "không được bỏ trống";
                        }

                        break;
                    }
                case "productId":
                    {
                        newError[prop] = "";
                        const REGEX_NUMBER = /^\d+$/;
                        if (! REGEX_NUMBER.test(value[prop])) {
                            newError[prop] = "phải là số";
                        }

                        // 1. không được bỏ trống
                        if (value[prop].length === 0) {
                            newError[prop] = "không được bỏ trống";
                        }

                        break;
                    }
                case "price": newError[prop] = "";
                    if (!(Number(value[prop]) <= 100 && Number(value[prop]) >= 5)) {
                        newError[prop] = "Price phải nằm trong khoảng từ 5 đến 100";
                    }
                    const REGEX_NUMBER = /^\d+$/;
                    if (! REGEX_NUMBER.test(value[prop])) {
                        newError[prop] = "phải là số";
                    }
                    if (value[prop].length === 0) {
                        newError[prop] = "không được bỏ trống";
                    }

                    break;
                case "image":
                    {
                        newError[prop] = "";
                        const REGEX_URL = /https?:\/\/(www\.)?[-a-zA-Z0-9@:%._\+~#=]{1,256}\.[a-zA-Z0-9()]{1,6}\b([-a-zA-Z0-9()@:%_\+.~#?&//=]*)/;
                        if (! REGEX_URL.test(value[prop])) {
                            newError[prop] = "Đường dẫn không hợp lệ.";
                        }
                        if (value[prop].length === 0) {
                            newError[prop] = "không được bỏ trống";
                        }
                        break;
                    }
                case "productType": newError[prop] = "";

                    if (value[prop].length === 0) {
                        newError[prop] = "không được bỏ trống";
                    }
                    break;
                case "productDesc":
                    break;
                default:
                    break;
            }
        }

        this.setState({error: newError});

        return newError;
    };

    handleChange = (event) => {
        const {target} = event;
        const {value, name} = target;
        /* eslint-disable */console.log(...oo_oo(`3138098732_0`,"before ::: set state"));
        flushSync(() => {
            this.setState({
                value: {
                    ...this.state.value,
                    [name]: value
                }
            });
        });

        this.handleValidate();
    };

    handleBlur = (event) => {
        const {name} = event.target;
        this.setState({
            touch: {
                ...this.state.touch,
                [name]: true
            }
        });

        this.handleValidate();
    };

    handleSubmit = (event) => {
        event.preventDefault();

        this.setState({
            touch: {
                id: true,
                productId: true,
                price: true,
                image: true,
                productType: true,
                productDesc: true
            }
        });
        const newError = this.handleValidate();
        const ready = Object.values(newError).every((i) => i.length === 0);
        if (ready === false) 
            return;
        

        // gửi lên redux
        const action = this.props.productEdit ? updateCreator(this.state.value) : submitCreator(this.state.value);
        this.props.dispatch(action);
        this.setState({
            value: {
                id: "",
                productId: "",
                price: "",
                image: "",
                productType: "",
                productDesc: ""
            },
            touch: {
                id: false,
                productId: false,
                price: false,
                image: false,
                productType: false,
                productDesc: false
            }
        });
    };
    static getDerivedStateFromProps(newProps, currentState) {
        /* eslint-disable */console.log(...oo_oo(`3138098732_1`,{newProps, currentState}));
        if (newProps.productEdit !== null) {
            if (newProps.productEdit.id !== currentState.value.id) 
                return {value: newProps.productEdit};
            
        }
        return null;
    }

    render() {
        /* eslint-disable */console.log(...oo_oo(`3138098732_2`,{props: this.props}));
        return (
            <form onSubmit={
                    this.handleSubmit
                }
                className="mt-4 p-4"
                style={
                    {boxShadow: "rgba(100, 100, 111, 0.2) 0px 7px 29px 0px"}
            }>
                <div className="row">
                    <div className="col-6">
                        <div className="mb-3">
                            <label htmlFor="id" className="form-label">
                                Id
                            </label>
                            <input onBlur={
                                    this.handleBlur
                                }
                                value={
                                    this.state.value.id
                                }
                                onChange={
                                    this.handleChange
                                }
                                disabled={
                                    this.props.productEdit
                                }
                                name="id"
                                className="form-control"
                                id="id"/> {
                            this.state.touch.id && this.state.error.id && (
                                <p className="text-danger">
                                    {
                                    this.state.error.id
                                }</p>
                            )
                        } </div>
                        <div className="mb-3">
                            <label htmlFor="product_id" className="form-label">
                                Product Id
                            </label>
                            <input onBlur={
                                    this.handleBlur
                                }
                                value={
                                    this.state.value.productId
                                }
                                name="productId"
                                onChange={
                                    this.handleChange
                                }
                                className="form-control"
                                id="product_id"/> {
                            this.state.touch.productId && this.state.error.productId && (
                                <p className="text-danger">
                                    {
                                    this.state.error.productId
                                }</p>
                            )
                        } </div>
                        <div className="mb-3">
                            <label htmlFor="price" className="form-label">
                                Price
                            </label>
                            <input onBlur={
                                    this.handleBlur
                                }
                                onChange={
                                    this.handleChange
                                }
                                value={
                                    this.state.value.price
                                }
                                name="price"
                                type="text"
                                className="form-control"
                                id="price"/> {
                            this.state.touch.price && this.state.error.price && (
                                <p className="text-danger">
                                    {
                                    this.state.error.price
                                }</p>
                            )
                        } </div>
                    </div>
                    <div className="col-6">
                        <div className="mb-3">
                            <label htmlFor="image" className="form-label">
                                Image
                            </label>
                            <input onBlur={
                                    this.handleBlur
                                }
                                onChange={
                                    this.handleChange
                                }
                                value={
                                    this.state.value.image
                                }
                                name="image"
                                type="text"
                                className="form-control"
                                id="image"/> {
                            this.state.touch.image && this.state.error.image && (
                                <p className="text-danger">
                                    {
                                    this.state.error.image
                                }</p>
                            )
                        } </div>
                        <div className="mb-3">
                            <label htmlFor="product_type" className="form-label">
                                Product type
                            </label>
                            <select name="productType"
                                onChange={
                                    this.handleChange
                                }
                                onBlur={
                                    this.handleBlur
                                }
                                value={
                                    this.state.value.productType
                                }
                                className="custom-select">
                                <option selected>Open this select menu</option>
                                <option value="1">Phone</option>
                                <option value="2">Tivi</option>
                                <option value="3">Laptop</option>
                            </select>

                            {
                            this.state.touch.productType && this.state.error.productType && (
                                <p className="text-danger">
                                    {
                                    this.state.error.productType
                                }</p>
                            )
                        } </div>
                        <div className="mb-3">
                            <label htmlFor="product_description" className="form-label">
                                Product description
                            </label>
                            <input name="productDesc"
                                onChange={
                                    this.handleChange
                                }
                                onBlur={
                                    this.handleBlur
                                }
                                value={
                                    this.state.value.productDesc
                                }
                                className="form-control"/> {
                            this.state.touch.productDesc && this.state.error.productDesc && (
                                <p className="text-danger">
                                    {
                                    this.state.error.productDesc
                                }</p>
                            )
                        } </div>
                    </div>
                </div>
                <button type="submit" className="btn btn-primary">
                    {
                    this.props.productEdit ? "Update" : "Submit"
                } </button>
            </form>
        );
    }
}

const mapStateToProps = (rootReducer) => {
    return {listProduct: rootReducer.reactFormReducer.listProduct, productEdit: rootReducer.reactFormReducer.productEdit};
};

